const HomePage = () => {
return (
    <div className="container row text-center">
    <div className="  mt-4 col-md-6 ">
    <p className="fonts" style={{fontFamily:"'Satisfy', cursive"}}>I'm a Web,   MERN, React Developer</p>
    </div>


    <div className="col-md-6">
    <img src="https://picsum.photos/200" alt="no image to preview" class="rounded-circle mt-2 "/>
    </div>
    </div>
)


};

export default HomePage;
